package icons

import (
	"github.com/gin-gonic/gin"
	"github.com/jasonlabz/knife4go/constant"
	"github.com/jasonlabz/knife4go/utils"
)

const (
	FAVICON_ICO_RELATIVE_PATH = constant.RootPath + "/favicon.ico"
	// 文件内容的16进制表示
	FAVICON_ICO_HEX_CONTENT = ``
)

func AddRouterOfFaviconICO(router gin.IRouter) {

	utils.GetOther(router, FAVICON_ICO_RELATIVE_PATH, FAVICON_ICO_HEX_CONTENT)

}
